import React from 'react';
import {
  AcademicCapIcon,
  ClipboardDocumentListIcon,
  ChartBarIcon,
} from '@heroicons/react/24/outline';

const Summary = () => {
  const topCards = [
    {
      title: 'Enrolled Students',
      count: 120,
      icon: <AcademicCapIcon className="h-10 w-10 text-blue-600" />,
      color: 'bg-blue-100',
    },
    {
      title: 'Essays Submitted',
      count: 90,
      icon: <ClipboardDocumentListIcon className="h-10 w-10 text-green-600" />,
      color: 'bg-green-100',
    },
    {
      title: 'Pending Submissions',
      count: 30,
      icon: <ChartBarIcon className="h-10 w-10 text-yellow-600" />,
      color: 'bg-yellow-100',
    },
  ];

  const progressData = [
    { week: 'Assessment Week 1', percentage: 80, color: 'bg-blue-500' },
    { week: 'Assessment Week 2', percentage: 60, color: 'bg-green-500' },
    { week: 'Assessment Week 3', percentage: 40, color: 'bg-yellow-500' },
  ];

  return (
    <div className="p-6 space-y-8">
      {/* Teacher Info and Notifications */}
      <div className="flex items-center justify-between">
        <div className="flex items-center space-x-4">
          <img
            src="https://via.placeholder.com/50"
            alt="Teacher Profile"
            className="w-14 h-14 rounded-full shadow-lg"
          />
          <div>
            <h1 className="text-2xl font-semibold text-gray-800">Welcome, Teacher!</h1>
            <p className="text-gray-500">Your Dashboard Overview</p>
          </div>
        </div>
        <button className="relative">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            viewBox="0 0 24 24"
            strokeWidth={2}
            stroke="currentColor"
            className="w-8 h-8 text-gray-600"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              d="M15 17h5l-1.405-1.405M15 17l-1.5-1.5M15 17v4m0-4H9m6-4V7a2 2 0 00-2-2h-4a2 2 0 00-2 2v6m0 0h6m0 0v6"
            />
          </svg>
          <span className="absolute top-0 right-0 bg-red-500 text-white text-xs px-1.5 py-0.5 rounded-full">
            3
          </span>
        </button>
      </div>

      {/* Top Summary Cards */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {topCards.map((card, index) => (
          <div
            key={index}
            className={`p-6 rounded-lg shadow-md flex items-center space-x-4 ${card.color}`}
          >
            <div className="p-4 rounded-full bg-white shadow-md">{card.icon}</div>
            <div>
              <h3 className="text-lg font-medium text-gray-600">{card.title}</h3>
              <p className="text-3xl font-extrabold text-gray-800">{card.count}</p>
            </div>
            <button className="ml-auto bg-gray-200 text-sm px-4 py-1 rounded-lg hover:bg-gray-300">
              View Details
            </button>
          </div>
        ))}
      </div>

      {/* Weekly Progress */}
      <div className="bg-white shadow-md rounded-lg p-6">
        <h2 className="text-xl font-semibold text-gray-800 mb-4">Weekly Progress</h2>
        <div className="space-y-4">
          {progressData.map((progress, index) => (
            <div key={index}>
              <div className="flex justify-between items-center mb-2">
                <span className="text-gray-700">{progress.week}</span>
                <span className="text-gray-600">{progress.percentage}%</span>
              </div>
              <div className="w-full bg-gray-200 h-4 rounded-full">
                <div
                  className={`h-4 rounded-full ${progress.color}`}
                  style={{ width: `${progress.percentage}%` }}
                ></div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Summary;
